import React, {Component} from 'react';
import ReactNative from 'react-native';

import Camera from 'react-native-camera';
import RNFS from 'react-native-fs';

import {
  Platform,
  AppRegistry,
  Dimensions,
  StyleSheet,  
  TouchableHighlight,
  View,
  Image,
  Alert
} from 'react-native';

import {
  Icon,
  Button,
  Text
} from "native-base";

import Modal from 'react-native-modal';
import firebaseApp from '../utils/firebase';
import RNFetchBlob from 'react-native-fetch-blob';
import DeviceInfo from 'react-native-device-info';

const Blob = RNFetchBlob.polyfill.Blob;
const fs = RNFetchBlob.fs;
window.XMLHttpRequest = RNFetchBlob.polyfill.XMLHttpRequest;
window.Blob = Blob;

class CameraPic extends Component {

  constructor(props) {
    super(props);
    
    this.camera = null;

    this.state = {
      dataPath: '',
      // tempImage: ''
      tempImage: '',
      uploading: false
    };
  }

  takePicture() {
    /*
    this.setState({
      tempImage: ''
    });
    return;
    */

    const options = {
    };
    
    this.camera.capture({metadata: options})
    .then((data) => {
      
      RNFS.readFile(data.path.substring(7), "base64").then(res => {
        this.setState({
          tempImage: res,
          dataPath: data.path
        });        
      });
      
    })
    .catch(err => {
      alert('err');
      alert(err);
    });      
  }

  upload() {
    this.setState({
      uploading: true
    });
    let _this = this;    

    /*
    const now = new Date();
    const timestamp = now.getTime();

    const photoId = timestamp;
    const urlRef = firebaseApp.database().ref(DeviceInfo.getUniqueID()+'/'+photoId+'/');
    urlRef.set( {
      'url': 'https://1.bp.blogspot.com/-_npHSApiFpY/WcNNKX-8t0I/AAAAAAAAQFc/uT_CIxAqvag9993-mMr_jQRjDSRoKWFmgCLcBGAs/s400/dark-pink-color-frock-wearing-babygirl-standinf-with-flowers.jpg',
      'id': photoId
    } );

    return;
    */
    const now = new Date();
    const timestamp = now.getTime();

    

    let uri = this.state.dataPath;
    
    const uploadUri = Platform.OS == 'ios' ? uri.replace('file://', '') : uri;
    let uploadBlob = null;
    const imageRef = firebaseApp.storage().ref('posts').child(timestamp+".jpg");
    let mime = 'image/jpg';

    fs.readFile(uploadUri, 'base64')
    .then((data) => {
      return Blob.build(data, { type: `${mime};BASE64` })
    })
    .then((blob) => {
      uploadBlob = blob
      return imageRef.put(blob, { contentType: mime })
    })
    .then(() => {
      uploadBlob.close()
      return imageRef.getDownloadURL()
    })
    .then((url) => {
      _this.setState({
        tempImage: '',
        uploading: false
      });
      // URL of the image uploaded on Firebase storage

      const photoId = timestamp;
      const urlRef = firebaseApp.database().ref(DeviceInfo.getUniqueID()+'/'+photoId+'/');
      urlRef.set( {
        'url': url,
        'id': photoId
      } );
      // upload the url to database

      // alert(url);
    })
    .catch((error) => {
      alert('Error occurs, Please check your network status.');
    });
    
  }

  render() {
    const {tempImage, uploading} = this.state;

    return (
      <View style={styles.container}>
        <Modal 
          isVisible={true}
          style={{flex: 1}}
        >
          <View style={styles.cameraModal}>
            
            <View style={{flex: 1}}>
              {
                tempImage == '' ?
                  <Camera
                    ref={(cam) => {
                      this.camera = cam;
                    }}
                    style={{flex: 1, justifyContent: 'flex-end', alignItems: 'center'}}
                    captureTarget={Camera.constants.CaptureTarget.temp}
                    captureQuality={Camera.constants.CaptureQuality.medium}
                    aspect={Camera.constants.Aspect.fill}>
                  </Camera>
                  :
                  <Image source={{uri: `data:image/png;base64,${tempImage}`}} style={{height: '100%', width: '100%'}} />
              }
            </View>

            <View style={{ flexDirection: 'row', paddingTop: 10, paddingBottom: 10, paddingLeft: 20, paddingRight: 20}}>
              <Button info onPress={()=>{
                /*
                this.setState({
                  tempImage: ''
                }, ()=>{
                  this.props.closeModal();
                });                
                */
                this.props.closeModal();
              }}>
               <Icon name='close' />
              </Button>

              {
                tempImage !== '' &&
                  <Button info style={{marginLeft: 20}} onPress={()=>{
                    this.upload();
                  }}>
                    {
                      uploading == true ?
                      <Text>Uploading...</Text>
                      :
                      <Icon name='cloud-upload'/>
                    }
                  </Button>
              }

              {
                tempImage != '' &&
                  <View style={{flex: 1, flexDirection: 'row', justifyContent: 'flex-end'}}>
                    <Button info onPress={()=>{
                      this.setState({
                        tempImage: ''
                      });
                    }}>
                      <Icon name='camera' />
                    </Button>
                  </View>
              }

              {
                tempImage == '' &&
                  <View style={{flex: 1, flexDirection: 'row', justifyContent: 'flex-end'}}>
                    <Button info onPress={()=>{
                      this.takePicture();
                    }}>
                      <Icon name='camera' />
                    </Button>
                  </View>
              }

            </View>

          </View>
        </Modal>
      </View>
    )
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1
  },
  preview: {
    flex: 1,
    alignItems: 'center'
  },
  cameraModal: {
    flex: 1, backgroundColor: 'black'
  }
});

export default CameraPic;